; Declaración del Segmento de Pila OBLIGATORIO

pila SEGMENT STACK 'STACK' ; Poner STACK es obligatorio

DB 128 dup ('pila')        ; Reservamos 512 bytes

pila ENDS


; Declaración del Segmento de Codigo OBLIGATORIO

codigo SEGMENT


 
main PROC FAR 

ASSUME CS:codigo, DS:datos, SS:pila

; Direccionar el segmento de datos con DS. OBLIGATORIO

  MOV AX,datos 
  MOV DS,AX 
  
  MOV AX,pantallaVirtual
  MOV ES,AX
    
  PUSH 13h		
  
  ;llamamos a la funcion
  CALL FAR PTR modografico
  
	PUSH DS					;segmento de sprite
	PUSH OFFSET sprite		;bytes del sprite
	PUSH X				;coordenada x=100
	PUSH Y				;coordenada y=100
	PUSH seg pantallaVirtual;segmento pantalla virtual
	
	CALL FAR PTR dibujaFotograma
	
	PUSH seg pantallaVirtual
	PUSH OFFSET pantallaVirtual
	
	CALL FAR PTR refrescar
	
			  
	;hacemos una pausa
	XOR AH,AH
	INT 16h

  
  ;volvemos al modo texto
  PUSH 02h
  CALL FAR PTR modografico
  
  
  MOV AX,4C00H ; Funcion de salida al DOS
  INT 21h ; Interrupcion 21= Llamada al DOS

main ENDP ; Fin del procedimiento principal

;La funcion esta aqui
modografico PROC FAR

	PUSH BP
	MOV BP,SP
		
	PUSH AX
	;Para cambiar a  modo 320X200 cargamos en AH 0, y en AL 13h q esta en la pila
	MOV AH,0h
	MOV AL,SS:[BP+6]
	INT 10h
	
	POP AX
	POP BP
	RETF 2
modografico ENDP



dibujaFotograma PROC FAR
 
  PUSH BP
  MOV BP,SP

  PUSH DS 
  PUSH DI
  PUSH DX 
  PUSH BX 
  PUSH SI
  PUSH ES  
  PUSH CX 
  PUSH DX 
  PUSH AX

  MOV DS, SS:[BP+14]             ; DS= Dirección memoria del fotograma.
  MOV SI, SS:[BP+12]             ; SI= segmento memoria del fotograma.
  MOV ES, SS:[BP+6]              ; ES= Segmento dirección pantalla.
  MOV AX, SS:[BP+10]             ; AX= coordenada Y.
  MOV BX, SS:[BP+8]              ; BX= coordenada x.
  
  
  MOV CX, 6
  SHL AX, CL
  ADD BX, AX      ;BX=coordenada x + coordenada  Y *64
  SHL AX, 1
  SHL AX, 1
  ADD BX, AX	;BX=coordenadaz +coordenada y * 64 +coordenada  Y*256
  MOV DI, BX     ;es lo mismo que filas*320+columnas pero  optimizado
  XOR CX, CX
  XOR BX, BX
  XOR SI, SI
  MOV BX, WORD PTR DS:[SI]       ; BX= ancho imagen
  ADD SI, 2
  MOV CX, WORD PTR DS:[SI]       ; CX=largo imagen
  ADD SI, 2
  MOV DX, BX  ;guardamos una copia del ancho



columnas:

     MOV AL, DS:[SI]
     MOV ES:[DI], AL
     DEC BX			;BX ancho actual
     INC SI
     INC DI
	 CMP BX, 0		;si BX==0 se acabo la linea actual
     JZ saltoLinea
     JMP columnas

saltoLinea:

     MOV AX, 320	;320 son las columnas de cada linea, como hay un salto se avanzan 320
     SUB AX, DX		;al salto de linea se le resta el ancho de la imagen para empezar a pintar dnd corresponde
     ADD DI, AX		;actulizamos DI para pintar
     MOV BX, DX		;restauramos BX al maximo ancho
     LOOP columnas	;en cx esta el largo de la imagen


  POP AX
  POP DX
  POP CX
  POP ES
  POP SI
  POP BX
  POP DX
  POP DI
  POP DS
  POP BP

  RETF 10 

dibujaFotograma ENDP



refrescar PROC  		; Refresca la pantalla virtual.

  PUSH BP
  MOV BP, SP

  PUSH ES
  PUSH DI
  PUSH DS
  PUSH SI
  PUSH CX
  PUSH AX

  XOR SI,SI
  MOV ES, SS:[BP+8]        ; ES= Segmento  pantalla virtual.
  MOV DI, SS:[BP+6]        ; DI=  Desplazamiento  pantalla virtual.
  MOV CX, 64000            ; CX= 64000 (tamaño  pantalla virtual, 64k).
  MOV AX, 0A000h           ; AX= Dirección pantalla real.
  MOV DS, AX

bucle:
     
    MOV BL, ES:[DI]        ; Volcamos la pantalla virtual en BL.
    MOV DS:[SI], BL        ; Movemos BL en la dirección de la pantalla real.
    INC SI
    INC DI
         
    LOOP bucle


  POP AX
  POP CX
  POP SI
  POP DS
  POP DI
  POP ES
  POP BP

  RETF 4


refrescar ENDP


codigo ENDS
END main 
